const myImage = new Image();

myImage.src = 'data:image/png;base64,';

myImage.addEventListener('load', function() {
  
  // get Image data, then clear image from canvas
  ctx.drawImage(myImage, 0, 0, canvas.width, canvas.height);
  const pixels = ctx.getImageData(0, 0, canvas.width, canvas.height);
  ctx.clearRect(0, 0, canvas.width, canvas.height);
  
  // Store brigntenss and color data for each cell of canvas
  setMappedImage(pixels);

  init();
  animate();
  
});

const canvas = document.getElementById('canvas1');
const ctx = canvas.getContext('2d');
  
canvas.width = 500;
canvas.height = 704;
  

let particlesArray = [];
const numberOfParticles = 5000;

let mappedImage = [];


class Particle {
  constructor() {
    this.x = Math.random() * canvas.width;
    this.y = 0;
    this.speed = 0;
    this.velocity = Math.random() * 0.5;
    this.size = Math.random() * 1.5 + 1;
    this.position1 = Math.floor(this.y);
    this.position2 = Math.floor(this.x);
  }

  update() {
    this.position1 = Math.floor(this.y);
    this.position2 = Math.floor(this.x);
    this.speed = mappedImage[this.position1][this.position2].brightness;

    let movement = (2.5 - this.speed) + this.velocity;

    this.y += movement;

    if(this.y >= canvas.height) {
      this.y = 0;
      this.x = Math.random() * canvas.width;
    }
  }

  draw(red, green, blue) {
    ctx.beginPath();
    ctx.fillStyle = `rgb(${red}, ${green}, ${blue})`;
    ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
    ctx.fill();
  }
}

function init() {
  for(let i = 0; i < numberOfParticles; i++) {
    particlesArray.push(new Particle);
  }
}

function animate() {
  ctx.globalAlpha = 0.05;
  ctx.fillStyle = 'rgb(0, 0, 0)';
  ctx.fillRect(0, 0, canvas.width, canvas.height);

  ctx.globalAlpha = 0.2;

  for(let i = 0; i < numberOfParticles; i++) {
    const particle = particlesArray[i];
    particle.update();

    const colors = mappedImage[particle.position1][particle.position2].color;
    
    // ctx.globalAlpha = particle.speed * 0.5;
    particle.draw(colors.red, colors.green, colors.blue);
  }

  requestAnimationFrame(animate);
}


function setMappedImage (pixels) {
  let currentPixelElement = 0;

  for (let y =0 ; y < canvas.height ; y++) {
    let row = [];

    for (let x = 0; x < canvas.width; x++) {
      const red = pixels.data[currentPixelElement];
      const green = pixels.data[currentPixelElement + 1];
      const blue = pixels.data[currentPixelElement + 2];
      const alpha = pixels.data[currentPixelElement + 3];

      const brightness = calculateRelativeBrightness(red, green, blue);
      const cell = {
        brightness,
        color: {
          red,
          green,
          blue
        }
      };

      row.push(cell);
      currentPixelElement += 4;
    }

    mappedImage.push(row);
  }
};

function calculateRelativeBrightness(red, green, blue) {
  return Math.sqrt(
    (red * red) * 0.299 + 
    (green * green) * 0.587 + 
    (blue * blue) * 0.114
  ) / 100;
}